import React from "react";
import RegFields from "./components/RegFields";
import "./LoginReg.css";

const Reg = () => {
  return (
    <React.StrictMode>
      <div className="center">
        <RegFields />
      </div>
    </React.StrictMode>
  );
};

export default Reg;
